import React from 'react';
import PostForm from './PostForm';
import PostList from './PostList';
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
  const { logout } = useAuth();
  return (
    <div>
      <button onClick={logout}>Logout</button>
      <PostForm />
      <PostList />
    </div>
  );
};

export default Dashboard;
